import React, {useState} from 'react';
import { BaseUrl } from './constants';



const Search = ({setSearchTerm}) => {
    let st = "";
    return(
        <form onSubmit = {(e) => {
            e.preventDefault();
        }}>
            <label>Search:</label>
            <input type = "text" onChange = {(e) => {
                st = e.target.value;
                e.target.value = st;
                setSearchTerm(st);
            }}/>
            <input type = "submit" />
        </form>
    )
}

export default Search;
